import React from 'react';
import { BrowserRouter as Router, Routes, Route, useLocation } from 'react-router-dom';
import Header from './components/Header';
import Hero from './components/Hero';
import About from './components/About';
import Projects from './components/Projects';
import Skills from './components/Skills';
import Contact from './components/Contact';
import Footer from './components/Footer';
import FinTechMobileApp from './components/projects/FinTechMobileApp';
import EcommercePlatform from './components/projects/EcommercePlatform';
import HealthcareDashboard from './components/projects/HealthcareDashboard';

const HomePage: React.FC = () => {
  return (
    <>
      <Hero />
      <About />
      <Projects />
      <Skills />
      <Contact />
    </>
  );
};

const App: React.FC = () => {
  return (
    <Router>
      <div className="App">
        <Header />
        <main>
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/projects/fintech-mobile-app" element={<FinTechMobileApp />} />
            <Route path="/projects/ecommerce-platform" element={<EcommercePlatform />} />
            <Route path="/projects/healthcare-dashboard" element={<HealthcareDashboard />} />
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
};

export default App;
